import React, { useState } from "react";
import "./CreateTask.css";
import { createTask } from "../../services/api-client";

const CreateTask = ({ onTaskCreated, onCancel, selectedSprintId, members }) => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [assignedTo, setAssignedTo] = useState("");
  const [dueDate, setDueDate] = useState("");
  const [status, setStatus] = useState("To-Do");
  const [progressPercentage, setProgressPercentage] = useState(0);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!title || !assignedTo || !dueDate) {
      alert("Please fill in all required fields (Title, Assigned To, Due Date).");
      return;
    }

    const newTask = {
      title,
      description,
      assigned_to: parseInt(assignedTo),
      due_date: dueDate,
      status,
      progress_percentage: parseInt(progressPercentage),
      sprint_id: selectedSprintId || 1, // Sử dụng selectedSprintId từ props
    };

    try {
      await createTask(newTask);
      onTaskCreated();
    } catch (error) {
      console.error("Error creating task:", error);
      alert("Failed to create task. Please try again.");
    }
  };

  return (
    <div className="create-task-modal">
      <form onSubmit={handleSubmit}>
        <h2>Create New Task</h2>
        <div className="form-group">
          <label>Title *</label>
          <input
            type="text"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Description</label>
          <textarea
            value={description}
            onChange={(e) => setDescription(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label>Assigned To *</label>
          <select
            value={assignedTo}
            onChange={(e) => setAssignedTo(e.target.value)}
            required
          >
            <option value="" disabled>Select a member</option>
            {members.map((member) => (
              <option key={member.user_id} value={member.user_id}>
                {member.username}
              </option>
            ))}
          </select>
        </div>
        <div className="form-group">
          <label>Due Date *</label>
          <input
            type="date"
            value={dueDate}
            onChange={(e) => setDueDate(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Status</label>
          <select value={status} onChange={(e) => setStatus(e.target.value)}>
            <option value="To-Do">To-Do</option>
            <option value="In-Progress">In-Progress</option>
            <option value="Completed">Completed</option>
          </select>
        </div>
        <div className="form-group">
          <label>Progress (%)</label>
          <input
            type="number"
            value={progressPercentage}
            onChange={(e) => setProgressPercentage(e.target.value)}
            min="0"
            max="100"
          />
        </div>
        <div className="form-actions">
          <button type="submit">Create</button>
          <button type="button" onClick={onCancel}>Cancel</button>
        </div>
      </form>
    </div>
  );
};

export default CreateTask;
